import { useSelector } from "react-redux";

const Paginate = () => {



    const {page} = useSelector(state =>  state);

    const next = () => {
        page++;
    }
    const back = () => {
        page + 1;
    }

    return (
        <div>
            <button onClick={back}>next</button>
            <p>{page - 1}</p>

            <p>{page}</p>

            <p>{page + 1}</p>

            <button onClick={next}>next</button>
        </div>
    )
}

export default Paginate;
